class dump_comment_account:
	def __init__(self,tp):
		global dump
		dump = self.dump = []
		self.fail        = []
		self.pisah       = pemisah
		self.limit       = '100'
		self.xyz         = requests.Session()
		self.cookie      = {'cookie':open('DATA LOGIN/cookiesakunfacebook.txt','r').read()}
		self.token_eaag  = open('token_eaag_dumpid.json','r').read()
		self.token_eaab  = open('token_eaab_dumpid.json','r').read()
		if tp   == 'A_K': self.modul = 'K'; self.main_DCA()
	def main_DCA(self):
		id = input(f'\33[m[\x1b[1;92m+\33[m] BANYAK ID PISAHKAN DENGAN TANDA \x1b[1;92mKOMA \33[m(\x1b[1;92m,\33[m) \n {asi}└──> \x1b[1;92m').split(',')
		for f in id:
			if f == 'me': io = f
			elif (re.findall("[a-zA-Z]",str(f))) : io = user_to_id(f)
			else : io = f
			self.cek_DCA(io)
		cetak(panel(f"{K2}                            TEKAN {H2}CTRL+C {K2}ATAU {H2}CTRL+Z {K2}UNTUK BERHENTI",width=100,style=f"bold green"))
		for d in self.fail:
			try: id.remove(d)
			except Exception as e: continue
		try:
			for s in id:
				if s == 'me': io = s
				elif (re.findall("[a-zA-Z]",str(s))) : io = user_to_id(s)
				else : io = s
				self.requ1_DCA(io)
		except KeyboardInterrupt: pass
		if len(self.dump) == 0: print('\r\33[m[\x1b[1;91mX\33[m] DUMP ID GAGAL !')
		else: print('\r\33[m[\x1b[1;92m+\33[m] BERHASIL DUMP \x1b[1;92m%s \33[mID'%(str(len(self.dump))))
	def cek_DCA(self,id):
		try:
			nama  = str(self.xyz.get('https://graph.facebook.com/%s?fields=name&access_token=%s'%(id,self.token_eaag),cookies=self.cookie).json()['name'])
			lisz  = [x['id'] for x in self.xyz.get('https://graph.facebook.com/%s/posts?fields=id&limit=%s&access_token=%s'%(id,self.limit,self.token_eaag),cookies=self.cookie).json()['data']]
			post  = str(len(lisz))
			print(f'\33[m[\x1b[1;92m+\33[m] {asi}NAMA \33[m| {asi}POSTINGAN \33[m: \x1b[1;92m%s \33[m| \x1b[1;92m%s'%(nama,post))
		except Exception as e:
			jalan(f"\33[m[\x1b[1;91mX\33[m] \x1b[1;92m{id}? {asi}---> \33[mKEMUNGKINAN AKUN TARGET PRIVATE \x1b[1;92mATAU \33[mTIDAK BERTEMAN DENGAN AKUN ANDA")
			self.fail.append(id)
	def requ1_DCA(self,id):
		lisz  = [x['id'] for x in self.xyz.get('https://graph.facebook.com/%s/posts?fields=id&limit=%s&access_token=%s'%(id,self.limit,self.token_eaag),cookies=self.cookie).json()['data']]
		try:
			for pid in lisz:
				if self.modul == 'K':
					url = 'https://mbasic.facebook.com/' + pid
					self.main_requ_comment(url)
				else:
					self.main_requ_react(pid)
		except Exception as e: pass
	def main_requ_comment(self,url):
		try:
			req = bs(self.xyz.get(url,cookies=self.cookie).content,'html.parser')
			for x in req.find_all('h3'):
				try:
					v    = x.find('a',href=True)
					nama = v.text
					if 'profile.php' in v['href']: id = re.search('profile.php\?id\=(.*?)\&amp',str(v)).group(1)
					else: id = user_to_id(v['href'].split('?')[0].replace('/',''))
					format = '%s%s%s'%(id,self.pisah,nama)
					if format in self.dump:pass
					else:self.dump.append(format)
					animasi()
				except Exception as e: continue
			nek = 'https://mbasic.facebook.com' + req.find('a',string=' Lihat komentar sebelumnya…')['href']
			self.main_requ_comment(nek)
		except Exception as e: pass

